import React from "react";
import {
  Accordion,
  AccordionItem,
  AccordionItemButton,
  AccordionItemHeading,
  AccordionItemPanel,
} from "react-accessible-accordion";

const Faqs = (props) => {
  const { questions } = props;
  return (
    <div className="faqs">
      <Accordion className="acc">
        {questions.map((item) => {
          return (
            <AccordionItem className='accItem'>
              <AccordionItemHeading className='accHead'>
                <AccordionItemButton>{item.question}</AccordionItemButton>
              </AccordionItemHeading>
              <AccordionItemPanel className="panel">
                {item.answer}
              </AccordionItemPanel>
            </AccordionItem>
          );
        })}
      </Accordion>
      <div>
        <img
          className="faqsimage"
          href="https://imgur.com/a/kV37dMu"
          alt="alt"
        />
      </div>
    </div>
  );
};

export default Faqs;
